  <script>
    findingscf = crossfilter(findings);


    function findplotpoints(cf, points) {
      let finddim = cf.dimension(function (d) {
        return [d[points[0]], d[points[1]], d[points[2]]];
      });

      let finddimpoints = finddim.top(Infinity);

      return finddimpoints;

      finddim.filterAll();
      finddim.dispose();


    }



function hovertext(d,hoverinfo) {

  let hovertext = "<br>";

if (hoverinfo) {
   hoverinfo.forEach(e => {
     hovertext += `${e}: ${d[e]}<br>`;
   });
}

return hovertext;

}


    function findplot(div, cf, points,hoverinfo) {
 





      let finddim = cf.dimension(function (d) {
        return [d[points[0]], d[points[1]], d[points[2]]];
      });

      let finddimpoints = finddim.top(Infinity);
      const grouparr = finddimpoints.map(function (d) {
          return d[points[2]]
        })
        .filter((v, i, a) => a.indexOf(v) === i);
       grouparr.sort();
      let data = [];



      let scatterRange = Math.floor(Math.abs.apply(null, [Math.min(
          Math.min.apply(null, finddim.top(Infinity).map(function (d) {
            return +d[points[0]]
          })),
          Math.min.apply(null, finddim.top(Infinity).map(function (d) {
            return +d[points[1]]
          }))
        ),
        Math.max(
          Math.max.apply(null, finddim.top(Infinity).map(function (d) {
            return +d[points[0]]
          })),
          Math.max.apply(null, finddim.top(Infinity).map(function (d) {
            return +d[points[1]]
          }))
        )

      ])) + 1;





      for (groupval of grouparr) {
        data.push({
          x: finddimpoints.map(function (d) {
            if (d[points[2]] === groupval) return d[points[0]]
          }),
          y: finddimpoints.map(function (d) {
            if (d[points[2]] === groupval) return d[points[1]]
          }),
          name: groupval,
          type: "scatter",
          mode: "markers",
          hovertext: finddimpoints.map(function (d) {
            if (d[points[2]] === groupval)
              return `<br>${points[0]}: ${d[points[0]]}<br>${points[1]}: ${d[points[1]]}<br>${points[2]}: ${d[points[2]]} ${hovertext(d,hoverinfo)}`;
          })
        });
      };



      data.push({
        x: finddimpoints.map(function (d) {
          return d[points[0]]
        }),
        yaxis: "y2",
        type: "histogram",
        showlegend: false,
        nbinsx: 15,
        xbins: {
          size: 1,
          start: -scatterRange,
        },

        name: points[0],
        marker: {
          color: "rgba(22,160,133 ,1)",
          line: {
            color: "rgba(0,0,0,1)",
            width: 1
          }
        }

      });

      data.push({
        y: finddimpoints.map(function (d) {
          return d[points[1]]
        }),
        xaxis: "x2",
        type: "histogram",
        showlegend: false,
        nbinsy: 15,
        ybins: {
          size: 1,
          start: -scatterRange,
        },

        name: points[1],
        marker: {
          color: "rgba(22,160,133 ,1)",
          line: {
            color: "rgba(0,0,0,1)",
            width: 1
          }
        }

      });
      data.push({
        yaxis: "y2",
        name: points[1],
        type: "histogram",
        nbinsx: 15,
        xbins: {
          size: 1,
          start: -scatterRange,
        },
        showlegend: false,
        marker: {
          color: "rgba(44,62,80 ,1)",
          line: {
            color: "rgba(0,0,0,1)",
            width: 1
          }
        }
      });

      data.push({
        xaxis: "x2",
        name: points[0],
        type: "histogram",
        nbinsy: 15,
        ybins: {
          size: 1,
          start: -scatterRange,
        },

        showlegend: false,
        marker: {
          color: "rgba(44,62,80 ,1)",
          line: {
            color: "rgba(0,0,0,1)",
            width: 1
          }
        }
      });



      let layout = {
        dragmode: "select",
        hovermode: "closest",
        height: "700",
        width: "700",
        xaxis: {
          domain: [0, 0.9],
          range: [-scatterRange, scatterRange],
          showgrid: false,
          title: {
            text: points[0]
          }
        },
        xaxis2: {
          showgrid: false,
          domain: [0.9, 1],
          tickvals: [],
        },
        yaxis: {
          range: [-scatterRange, scatterRange],
          showgrid: false,
          domain: [0, 0.9],
          title: {
            text: points[1]
          }
        },
        yaxis2: {
          showgrid: false,
          domain: [0.9, 1],
          tickvals: [],
        },
        barmode: "overlay",
      };

      Plotly.react(div, data, layout, {
        responsive: true
      });

      finddim.filterAll();
      finddim.dispose();


    };






    function scatterselect(d, div, cf, points) {
      let selected = d.points.map(function (d) {
        return [d.x, d.y, d.data.name];
      });
      let selecteddim = cf.dimension(function (d) {
        return [d[points[0]], d[points[1]], d[points[2]]]
      });



      let selecteddimpoints = selecteddim.top(Infinity);
      const grouparr = selecteddimpoints.map(function (d) {
          return d[points[2]]
        })
        .filter((v, i, a) => a.indexOf(v) === i);



      selecteddim.filter(function (d) {
        return selected.toString().indexOf(d.toString()) != -1;
      });

      Plotly.restyle(div, {
        'x': [selecteddim.top(Infinity).map(function (d) {
          return d[points[0]]
        })]
      }, [grouparr.length + 2]);


      Plotly.restyle(div, {
        'y': [selecteddim.top(Infinity).map(function (d) {
          return d[points[1]]
        })]
      }, [grouparr.length + 3]);


      onanyselect(selecteddim, div);
      console.log([selecteddim.top(Infinity), div]);


      selecteddim.filterAll();
      selecteddim.dispose();

    };


    function onfilter(div, dim, points, finddimpoints) {




      const grouparr = finddimpoints.map(function (d) {
          return d[points[2]]
        })
        .filter((v, i, a) => a.indexOf(v) === i);

      Plotly.restyle(div, {
        'x': [dim.top(Infinity).map(function (d) {
          return d[points[0]]
        })]
      }, [grouparr.length + 2]);


      Plotly.restyle(div, {
        'y': [dim.top(Infinity).map(function (d) {
          return d[points[1]]
        })]
      }, [grouparr.length + 3]);


      let selectedindices = dim.top(Infinity).map(function (d) {
        if (finddimpoints.indexOf(d) != -1) return finddimpoints.indexOf(d)
      });

      console.log(selectedindices);

      Plotly.restyle(div, {
        'selectedpoints': [selectedindices]
      }, grouparr.map((d) => grouparr.indexOf(d)));




    }



    function onanyselect(dim, source) {

      if (source != "altscatter") {
        onfilter("altscatter", dim, ["ALT Log2(Baseline/ULN)", "ALT Log2(TrialMean/ULN)",
          "Age Group 1"
        ], altdimpoints);
      };

      if (source != "astscatter") {
        onfilter("astscatter", dim, ["AST Log2(Baseline/ULN)", "AST Log2(TrialMean/ULN)",
          "Age Group 1"
        ], astdimpoints);
      };
    };


    function resetall() {
      findplot("astscatter", findingscf, ["AST Log2(Baseline/ULN)", "AST Log2(TrialMean/ULN)", "Age Group 1"],['Sex','Race','Unique Subject Identifier']);
      astdimpoints = findplotpoints(findingscf, ["AST Log2(Baseline/ULN)", "AST Log2(TrialMean/ULN)",
        "Age Group 1"
      ]);
      findplot("altscatter", findingscf, ["ALT Log2(Baseline/ULN)", "ALT Log2(TrialMean/ULN)", "Age Group 1"],['Sex','Race','Unique Subject Identifier']);
      altdimpoints = findplotpoints(findingscf, ["ALT Log2(Baseline/ULN)", "ALT Log2(TrialMean/ULN)",
        "Age Group 1"
      ]);


    }



    function getOptions(div, cf, variable) {

      let optiondim = cf.dimension((d) => d[variable]);
      const optpoints = optiondim.top(Infinity);
      const optarray = optpoints.map(function (d) {
          return d[variable]
        })
        .filter((v, i, a) => a.indexOf(v) === i);

        optarray.sort();

        let e = '';
      for (val of optarray) {
        e += `<option value="${val}">${val}</option>`;

      }

      document.getElementById(div).innerHTML = e;
    };
  </script>

</head>

<body>

      <div class="form-group">

        function SexListener(div, cf, variable) {

          document.getElementById(div).addEventListener('change', function (event) {


            const optarray = Array.prototype.slice.call(this.selectedOptions, 0).map((d) => d.innerText);


            if (event.target.value) {
              console.log(optarray);

              Sexdim.filterAll();
              Sexdim.filter(function (d) {
                return optarray.indexOf(d) != -1;
              });
              resetall();

            } else {
              Sexdim.filterAll();

            }

          });
